script: |
  super -f text -I q9840.spq | sort > q9840.out

inputs:
  - name: q9840.spq
    data: |
      SELECT + ( + col2 ) AS col2, - col0 - - 57 AS col1, + + col1 * ( - 89 ) + col2 FROM tab2 (FORMAT parquet) WHERE NOT + - ( col2 ) + - col2 NOT BETWEEN + 88 AND NULL;
  - name: tab2

outputs:
  - name: q9840.out
    data: |
